var title_f8_14_8427="Etiology of pelvic trigger points";
var content_f8_14_8427=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F69783&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F69783&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Possible etiologies of female pelvic myofascial trigger points",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Chronic repetitive contraction of pelvic floor muscles. This may be related to sexual issues, urinary or fecal incontinence, emotional stress, dance training, or other precipitating factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Repetitive minor trauma from straining due to constipation or urinary obstruction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sudden severe strain sustained during physical activities, such as sports or dance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Direct physical trauma (eg, chilbirth, urogenital surgery, bicycling).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Local inflammation (eg, cystitis, proctitis, vaginitis).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Referred pain from other attaching muscle groups or viscera or nerves.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poor posture/ergonomics.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
