var title_f8_14_8428="Risk classification diabetic foot";
var content_f8_14_8428=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F70817&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F70817&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk classification based on the comprehensive foot examination",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Risk category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Definition",
"       </td>",
"       <td class=\"subtitle1\">",
"        Treatment recommendations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Suggested follow-up",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        No LOPS, no PAD, no deformity",
"       </td>",
"       <td>",
"        Patient education including advice on appropriate footwear.",
"       </td>",
"       <td>",
"        Annually (by generalist and/or specialist)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        1",
"       </td>",
"       <td rowspan=\"2\">",
"        LOPS &plusmn; deformity",
"       </td>",
"       <td>",
"        Consider prescriptive or accommodative footwear.",
"       </td>",
"       <td rowspan=\"2\">",
"        Every three to six months (by generalist or specialist)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider prophylactic surgery if deformity is not able to be safely accommodated in shoes. Continue patient education.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        2",
"       </td>",
"       <td rowspan=\"2\">",
"        PAD &plusmn; LOPS",
"       </td>",
"       <td>",
"        Consider prescriptive or accommodative footwear.",
"       </td>",
"       <td rowspan=\"2\">",
"        Every&nbsp;two to three&nbsp;months (by specialist)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider vascular consultation for combined follow-up.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        3",
"       </td>",
"       <td rowspan=\"2\">",
"        History of ulcer or amputation",
"       </td>",
"       <td>",
"        Same as category 1.",
"       </td>",
"       <td rowspan=\"2\">",
"        Every&nbsp;one to&nbsp;two&nbsp;months (by specialist)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider vascular consultation for combined follow-up if PAD present.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LOPS: loss of protective sensation; PAD: peripheral arterial disease.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Boulton AJM, Armstrong DG, Albert ST, et al. Comprehensive Foot Examination and Risk Assessment: A report of the Task Force of the Foot Care Interest Group of the American Diabetes Association, with endorsement by the American Association of Clinical Endocrinologists. Diabetes Care 2008; 31:1679. Copyright &copy;2008 American Diabetes Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
