var title_f8_14_8429="Medications for adult procedural sedation";
var content_f8_14_8429=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F52744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F52744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Intravenous procedural sedation medications for adults*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Medication",
"      </td>",
"      <td class=\"subtitle1\">",
"       Initial dose",
"      </td>",
"      <td class=\"subtitle1\">",
"       Onset (minutes)",
"      </td>",
"      <td class=\"subtitle1\">",
"       Duration (minutes)",
"      </td>",
"      <td class=\"subtitle1\">",
"       Repeat dose (as necessary)",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Midazolam",
"      </td>",
"      <td>",
"       0.02 to 0.03 mg/kg over 2 to 3 minutes; maximum 2.5 mg (1.5 mg maximum if elderly)",
"      </td>",
"      <td>",
"       1 to 2.5",
"      </td>",
"      <td>",
"       10 to 40",
"      </td>",
"      <td>",
"       May repeat after 2 to 5 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Sedative and anxiolytic. No analgesia.",
"       </p>",
"       <p>",
"        Relatively slow onset; requires more gradual initiation.",
"       </p>",
"       <p>",
"        Prolonged effect or delayed recovery in elderly, obese, or impaired hepatic function.",
"       </p>",
"       <p>",
"        Use reduced dose in combination with other agents.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Methohexital",
"      </td>",
"      <td>",
"       0.75 to 1 mg/kg",
"      </td>",
"      <td>",
"       1",
"      </td>",
"      <td>",
"       10",
"      </td>",
"      <td>",
"       0.5 mg/kg every 2 to 5 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Sedative and amnestic. No analgesia.",
"       </p>",
"       <p>",
"        Cardiorespiratory depression, hypotension, tachycardia can occur.",
"       </p>",
"       <p>",
"        Can precipitate or worsen seizures.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Etomidate",
"      </td>",
"      <td>",
"       0.1 to 0.15 mg/kg",
"      </td>",
"      <td>",
"       5 to 15 seconds",
"      </td>",
"      <td>",
"       5 to 15",
"      </td>",
"      <td>",
"       0.05 mg/kg every 3 to 5 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Sedative. No analgesia.",
"       </p>",
"       <p>",
"        Generally maintains cardiorespiratory stability.",
"       </p>",
"       <p>",
"        Elderly or renal/hepatic insufficiency: use lower dose range.",
"       </p>",
"       <p>",
"        Myoclonus, injection site pain, nausea/vomiting may occur.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Fentanyl",
"      </td>",
"      <td>",
"       0.5 to 1 mcg/kg",
"      </td>",
"      <td>",
"       2 to 3",
"      </td>",
"      <td>",
"       30 to 60",
"      </td>",
"      <td>",
"       0.5 mcg/kg every 2 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Analgesic. No amnesia.",
"       </p>",
"       <p>",
"        Minimal hypotension and histamine release.",
"       </p>",
"       <p>",
"        Use reduced dose in combination with other agents.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Ketamine",
"      </td>",
"      <td>",
"       1 to 2 mg/kg over 1 to 2 minutes",
"      </td>",
"      <td>",
"       0.5",
"      </td>",
"      <td>",
"       5 to 20",
"      </td>",
"      <td>",
"       0.25 to 0.5 mg/kg every 5 to 10 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Dissociative sedative, analgesic, and amnestic.",
"       </p>",
"       <p>",
"        Minimal cardiorespiratory depression.",
"       </p>",
"       <p>",
"        Does not inhibit protective reflexes.",
"       </p>",
"       <p>",
"        Sympathetic stimulation, tachycardia, hypertension may occur (rare).",
"       </p>",
"       <p>",
"        Emergence reactions common in adults. Nausea and vomiting may occur.",
"       </p>",
"       <p>",
"        Prolonged effect in elderly.",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Propofol",
"      </td>",
"      <td>",
"       0.5 to 1 mg/kg",
"      </td>",
"      <td>",
"       0.5",
"      </td>",
"      <td>",
"       5",
"      </td>",
"      <td>",
"       0.5 mg/kg every 3 to 5 minutes",
"      </td>",
"      <td>",
"       <p>",
"        Sedative and amnestic. No analgesia.",
"       </p>",
"       <p>",
"        Rapid onset and neurological recovery.",
"       </p>",
"       <p>",
"        Respiratory depression, hypotension, injection site pain may occur.",
"       </p>",
"       <p>",
"        Elderly: reduce dose by 20 percent, slower administration.",
"       </p>",
"       <p>",
"        Contains egg lecithin, soybean oil (potential allergens)",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Elderly patients are at increased risk of adverse events with these agents and dosing should be adjusted accordingly. See text for details.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Gan, TJ Pharmacokinetic and pharmacodynamic characteristics of medications used for moderate sedation. Clin Pharmacokinet 2006;45(9):855-869. Falk, J, Zed, P, Etomidate for procedural sedation in the emergency department. Ann Pharmacother 2004;38:1272-7.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
